          className={`${styles.pin} ${styles.pin__2}`}
          onMouseEnter={() => props.onShowModal("Fukuoka")}
        ></img>
        <img
          src={pin}
          className={`${styles.pin} ${styles.pin__3}`}
          onMouseEnter={() => props.onShowModal("Nishio")}
        ></img>
      </div>
    </div>
  );
};

export default RegionsMap;
